import React from "react";

class PersonDetails extends React.Component {
  render() {
    const { name, age } = this.props;

    return (
      <div>
        <h2>Child Component</h2>
        <p>Name: {name}</p>
        <p>Age: {age}</p>
      </div>
    );
  }
}

export default PersonDetails;
